const startDemo = (imgurl) => {
	const productPage = { 
		product_id: "000000000000000000000000", 
		img_url: imgurl,
		contents: { 
			artificial_sweeteners: [ 
				{ 
					name: "sugar" 
				} 
			] 
		} 
	}
	localStorage.setItem('000000000000000000000000', JSON.stringify(productPage));
	console.log(productPage);
	return productPage;
}

export default startDemo;
